import React from 'react';
import styled from 'styled-components';

function TagListItem() {
	return (
		<Button type="button">
			연봉이 최고의 복지
			<img
				src="https://static.wanted.co.kr/images/tags/634f02e0-9f6e-11ec-b909-0242ac120002.png"
				alt="연봉이 최고의 복지"
			/>
		</Button>
	);
}

const Button = styled.button`
	white-space: pre;

	/* 바꿀 것 */
	background: rgb(242, 251, 245);
	position: relative;
	height: 32px;
	padding: 8px 14px;
	border-radius: 20px;
	display: inline-flex;
	justify-content: center;
	align-items: center;
	margin-right: 8px;
	font-size: 13px;
	line-height: 16px;
	font-weight: 400;
	color: #333;
	padding-right: 20px;
	border: 1px solid transparent;
	> img {
		width: 16px;
		height: 16px;
		margin-left: 5px;
		display: block;
	}
`;

export default TagListItem;
